import React from 'react'
import Task from '../Task/Task'
import {Droppable} from 'react-beautiful-dnd';

export default function Column(props) {
    return (
        <div>
            <h1>{props.column.title}</h1>
            <div>
                {
                    props.tasks.map((task)=><Task key={task.id} task={task} />)
                }
            </div>
        </div>
    )
}
